export default class Container extends Component {
  constructor(props) {
    super(props)

    this.state = {
      name: '',
      author: '',
      about: '',
      colorful: '',
      styl: '',
      step: 1
    }
  }

  handleSendToLocalStorage = () => {
    new Promise((resolve, reject) => {
      localStorage.setItem('bookName', this.state.name)
      localStorage.setItem('bookAuthor', this.state.author)
      localStorage.setItem('bookAbout', this.state.about)
      console.log('Almost Done')
      resolve()
    })
    console.log(this.state.colorful)
    console.log(this.state.styl)
    if (this.state.colorful == 'true') {
      if (this.state.styl == 'abstract') {
        window.location.href = '/prototypes/4'
      } else if (this.state.styl == 'classic') {
        window.location.href = '/prototypes/5'
      }
    } else {
      if (this.state.styl) {
        if (this.state.styl == 'abstract') {
          window.location.href = '/prototypes/2'
        } else if (this.state.styl == 'classic') {
          window.location.href = '/prototypes/3'
        }
      }
    }
  }

  handleNameType = (event) => {
    const { name } = this.state
    console.log(name)
    this.setState({
      name: event.target.value
    })
  }

  handleAuthorType = (event) => {
    const { author } = this.state
    console.log(author)
    this.setState({
      author: event.target.value
    })
  }

  handleAboutType = (event) => {
    const { about } = this.state
    console.log(about)
    this.setState({
      about: event.target.value
    })
  }

  render() {
    const { colorful, styl, step } = this.state

    return (
      <div id="prototype_1">
        <div className="Container">
          <Header isDisabled="guideline" />
          <div className="MainColumn" id="guide">
            <HugeCard
              Icon={
                step == 1
                  ? step1
                  : step == 2
                  ? step2
                  : step == 3
                  ? step3
                  : step == 4
                  ? step4
                  : step == 5
                  ? step5
                  : step == 6
                  ? step6
                  : step1
              }
              text1={
                step == 1
                  ? 'Этот гайд призван объяснить, как сделать мега-крутые суперобложки. Пройдись по следующим шагам, чтобы понять как работать с сайтом и как поступить с готовыми изображениями.'
                  : step == 2
                  ? 'Нажми на кнопку «Начать генерацию» в карточке на главной или перейди по кнопке «Генерить» в навбаре. Ты попадёшь на страницу основных настроек обложки.'
                  : step == 3
                  ? 'Великолепно! Теперь ты видишь первый сгенерированный вариант обложки. Если тебя и так все устраивает — жми на кнопку «скачать» в левом нижнем углу экрана.'
                  : step == 4
                  ? 'Этот шаг не обязательный. В правой части экрана ты увидишь панель настройки суперобложки. Меняй цвета и заполненность изображения под себя.'
                  : step == 5
                  ? 'В любом знакомом тебе графическом редакторе соедини загруженные изображения в одно. Отправь в печать предварительно отключив режим «заполнить лист полностью».'
                  : step == 6
                  ? 'Готово! Возьмите распечатанный лист и оберните им книгу удобным для вас способом. Подрежьте части бумаги, которые вам не нравятся и ставьте на полку. Готовы приступить?'
                  : ''
              }
              text2={
                step == 1
                  ? ''
                  : step == 2
                  ? 'Выбери из предложенных вариантов желаемую стилистику и введи значения для названия книги, имени автора и описания.'
                  : step == 3
                  ? 'В случае если ты хочешь посмотреть на другие варианты этой обложки — кликай на соседнюю кнопку рандомайзера.'
                  : step == 4
                  ? 'Учти, что в режиме кастомных настроек включается автоматический рандом! Чтобы остановить процесс — кликни ещё раз по выбранной настройке, чтобы вернуться к началу — обнови страницу.'
                  : step == 5
                  ? ''
                  : step == 6
                  ? ''
                  : ''
              }
            >
              <>
                {step == 1 && (
                  <SC_Button
                    buttonType="select"
                    text=""
                    id="substep"
                  ></SC_Button>
                )}
                {step == 2 && (
                  <>
                    <SC_Button
                      buttonType="select"
                      text="1/"
                      id="s1_1"
                    ></SC_Button>
                    <SC_Button
                      buttonType="select"
                      text="2/"
                      id="s1_2"
                    ></SC_Button>
                  </>
                )}
                {step == 3 && (
                  <>
                    <SC_Button
                      buttonType="select"
                      text="1/"
                      id="s2_1"
                    ></SC_Button>
                    <SC_Button
                      buttonType="select"
                      text="2/"
                      id="s2_2"
                    ></SC_Button>
                  </>
                )}
                {step == 4 && (
                  <>
                    <SC_Button
                      buttonType="select"
                      text="1/"
                      id="s3_1"
                    ></SC_Button>
                    <SC_Button
                      buttonType="select"
                      text="2/"
                      id="s3_2"
                    ></SC_Button>
                  </>
                )}
                {step == 5 && (
                  <>
                    <SC_Button
                      buttonType="select"
                      text="1/"
                      id="s4_1"
                    ></SC_Button>
                    <SC_Button
                      buttonType="select"
                      text="2/"
                      id="s4_2"
                    ></SC_Button>
                  </>
                )}
                {step == 6 && (
                  <div style={{ display: 'flex', flexDirection: 'column', width: "100%", height: "100%", justifyContent: "flex-end", gap: 8 }}>
                    <SC_Button
                      buttonType="link"
                      buttonLink="/"
                      text="Вернуться на главную"
                      id="supersecondary"
                    ></SC_Button>
                    <SC_Button
                      buttonType="link"
                      buttonLink="/prototypes/1"
                      text="Начать генерировать"
                    ></SC_Button>
                  </div>
                )}
              </>
            </HugeCard>
            <div className="StepsWrapper">
              <div
                className={step == 1 ? 'Step Done' : 'Step'}
                style={{ cursor: 'pointer' }}
                onClick={() => this.setState({ step: 1 })}
              ></div>
              <div
                className={step == 2 ? 'Step Done' : 'Step'}
                style={{ cursor: 'pointer' }}
                onClick={() => this.setState({ step: 2 })}
              ></div>
              <div
                className={step == 3 ? 'Step Done' : 'Step'}
                style={{ cursor: 'pointer' }}
                onClick={() => this.setState({ step: 3 })}
              ></div>
              <div
                className={step == 4 ? 'Step Done' : 'Step'}
                style={{ cursor: 'pointer' }}
                onClick={() => this.setState({ step: 4 })}
              ></div>
              <div
                className={step == 5 ? 'Step Done' : 'Step'}
                style={{ cursor: 'pointer' }}
                onClick={() => this.setState({ step: 5 })}
              ></div>
              <div
                className={step == 6 ? 'Step Done' : 'Step'}
                style={{ cursor: 'pointer' }}
                onClick={() => this.setState({ step: 6 })}
              ></div>
            </div>
          </div>
        </div>
      </div>
    )
  }
}
